description:
Verenigd Koninkrijk
Komedie / Roadmovie
90 minuten

goeie film en een goed verhaal

met Rowan Atkinson, Willem Dafoe en Jean Rochefort

Mr. Bean wint een vakantie naar Frankrijk. Hij pakt zijn koffer en camcorder en verlaat het natte, troosteloze Londen. De reis naar de Franse kust verloopt echter niet zo vlot als gewenst. Overal waar hij komt, krijgt de eeuwig stuntelende Bean te maken met ongelukjes en toevalligheden. Aan het einde van zijn tocht door het Franse platteland wacht het mondaine Cannes. Onderweg heeft Bean gezelschap opgescharreld: het zoontje van een Cannes jurylid en een eerzuchtige actrice wijken niet van zijn zijde:
